                        <span>{this.state.email}</span>
                        <span>
                            <button>查看</button>
                            <button>删除</button>
                        </span>
                    </li>)
                }
                    <li>
                        <input type='checkbox'  />
                        
                    </li>
                </div>
            </div>
        )
    }
}
